def eval(guess, answer):
    count_white = 0
    count_black = 4
    remaining_guess = []
    remaining_code = []
    # count black
    for i in range(4):
        if guess[i] != answer[i]:
            count_black -= 1
            remaining_guess.append(guess[i])
            remaining_code.append(answer[i])

    # count white
    for color_guess in remaining_guess:
        if color_guess in remaining_code:
            remaining_code.remove(color_guess)
            count_white += 1
    
    return count_black, count_white

